import {
  dirname,
  posix,
  relative,
  sep
} from 'node:path';
import {
  fileURLToPath,
  pathToFileURL
} from 'node:url';
import shared from './eslint.shared.config.mjs';
import {
  sync
} from 'globby';

const __filename = fileURLToPath(import.meta.url);
